for i in range(len(dev)):
    e2.append(x[i]-dev[i])


plt.xlabel("Generations")
plt.ylabel("Average mean fitness")
plt.fill_between(y, e1, e2, color='paleturquoise')
plt.plot(y, x, color='r')


plt.xlim(-20, 5000)
plt.ylim(min(mean)-100, max(mean)+100)

plt.show()

